  false,\n\t\"url\": null,\n\t\"notes\": \"New York City's \"MWBE\" program, enacted
  by the City Council and signed by the Mayor as Local Law 129 of 2005, is designed
  to promote government contracting opportunities for businesses owned by minorities
  and women. Our \"Emerging Business Enterprise\" program, enacted by the City Council
  and signed by the Mayor as Local Law 12 of 2006, is designed to promote such opportunities
  for businesses owned by persons who are \"socially and economically disadvantaged.\"
  Together, the programs establish the following Citywide goals for contracts and
  subcontracts in amounts under $1 million.\",\n\t\"license_title\": \"License Not
